import itertools; import math; import operator; import random; from bisect import *; from collections import deque, defaultdict, Counter, OrderedDict; from heapq import *; import unittest; from typing import List;
def get_sol(): return Solution()
# class Solution:
    # bfs
# class Solution:
    # union find
class Solution:
    # dfs
    # https://leetcode.com/problems/minimize-malware-spread-ii/discuss/184645/Straightforward-DFS-Java-6-ms
    def minMalwareSpread(self, graph: List[List[int]], initial: List[int]) -> int:
        def dfs(vis:set,u:int):
            if u in vis: return 0
            if u in mal: return -1
            vis.add(u)
            res=1
            for v in range(len(graph)):
                if v!=u and graph[u][v]:
                    tmp=dfs(vis,v)
                    if tmp<0:
                        mal.add(u)
                        return -1
                    res+=tmp
            return res

        initial.sort()
        n=len(graph)
        mal=set(initial)
        maxx=float('-inf')
        idx=-1
        for u in initial:
            save=0
            vis=set()
            vis.add(u)
            for v in range(n):
                if v!=u and graph[u][v]:
                    tmp=dfs(vis,v)
                    if tmp<0: continue
                    save+=tmp
            if save>maxx:
                maxx=save
                idx=u
        return idx

class MyTestCase(unittest.TestCase):
    def test01(self):
        self.assertEqual(0,get_sol().minMalwareSpread([[1,1,0],[1,1,0],[0,0,1]], [0,1]))
    def test02(self):
        self.assertEqual(1,get_sol().minMalwareSpread([[1,1,0],[1,1,1],[0,1,1]], [0,1]))
    def test03(self):
        self.assertEqual(1,get_sol().minMalwareSpread([[1,1,0,0],[1,1,1,0],[0,1,1,1],[0,0,1,1]], [0,1]))
    def test04(self):
        self.assertEqual(2,get_sol().minMalwareSpread([[1,1,1],[1,1,0],[1,0,1]], [2]))
    def test05(self):
        self.assertEqual(2,get_sol().minMalwareSpread([[1,1,1,0],[1,1,0,0],[1,0,1,0],[0,0,0,1]], [3,2]))
